	(2352, 'John R. D\'Araujo Jr. is a retired United States Army major general who served as Director of the Army National Guard and an official with the Federal Emergency Management Agency. He is the first Filipino American to achieve the rank of major general.@en', 7),
	(2353, 'Capitaine Georges Marcel Lachmann was a French World War I flying ace. He was credited with nine confirmed aerial victories.@en', 6),
	(2354, 'Alexander Russell Bolling was a general in the United States Army during World War II and the Cold War.@en', 6),
	(2355, 'Polly A. Peyer is a retired Major General in the U.S. Air Force. She previously commanded the Warner Robins Air Logistics Center at Robins AFB in Warner Robins, Georgia.She has served as the Director of Logistics, Headquarters Pacific Air Forces, at the Hickam Air Force Base in Hawaii. In addition she served as military assistant to the acting Secretary of the Air Force.@en', 6),
	(2356, 'Lauri Allan Trni (28 May 1919  18 October 1965), later known as Larry Thorne, was a Finnish Army captain who led an infantry company against the Soviet Union in the Finnish Winter and Continuation Wars and moved to the United States after World War II. He fought under three flags: Finnish, German (when he again fought the Soviets in World War II), and American (where he was known as Larry Thorne) when he served in U.S. Army Special Forces in the Vietnam War.@en', 6),
