	(5540, 'Jenniffer Aydin Gonzlez Coln (born August 5, 1976) is a politician and Republican that has occupied numerous leadership positions in the New Progressive Party (PNP in Spanish) and that is the current Chairwoman of the Puerto Rico Republican Party. Today, Gonzlez serves in three prominent roles: as Minority Leader of the House of Representatives of Puerto Rico, as vice-chair of the PNP, and as the chair of the Puerto Rico Republican Party.@en', 10),
	(5541, 'Mnica Oltra Jarque (Valencian: [?m?nika ??lt?a]; birth name: Mnica [?monika].@en', 10),
	(5542, 'Ralph Bruce Fitch, is a Canadian politician, the Leader of the Opposition of New Brunswick and Interim Leader of the New Brunswick Progressive Conservatives. He represents Riverview in the Legislative Assembly of New Brunswick.@en', 8),
	(5543, 'Du Xi (birth and death dates unknown), courtesy name Zixu, was an adviser to the warlord Cao Cao in the late Eastern Han dynasty. He was a subordinate of Cao Cao\'s general Xiahou Yuan. Du Xi proposed to the troops that Zhang He take command after Xiahou Yuan was killed at the Battle of Mount Dingjun. He continued serving as an official in the state of Cao Wei, established by Cao Cao\'s successor Cao Pi, during the Three Kingdoms period.@en', 8),
	(5544, 'Muse Rabile Ghod or Muse Rabile Got (Somali: Muuse Rabiile Good, Arabic: ???? ???? ????) also known as or Col. Muse Rabile Goad; was a Somali military leader, colonel, minister and politician of the former Somali Democratic Republic.@en', 8),
