	(5564, 'Alfred \\"Alf\\" Robens, Baron Robens of Woldingham, PC (18 December 1910  27 June 1999) was an English trade unionist, Labour politician and industrialist. His political ambitions, including an aspiration to become Prime Minister, were frustrated by bad timing; but his energies were diverted into industry: he spent a decade as chair of the National Coal Board, and later headed a major inquiry which resulted in the Robens Report on health, safety and welfare at work.@en', 4),
