	(6254, 'Ralph Bruce Fitch, is a Canadian politician, the Leader of the Opposition of New Brunswick and Interim Leader of the New Brunswick Progressive Conservatives. He represents Riverview in the Legislative Assembly of New Brunswick.@en', 8),
	(6255, 'Du Xi (birth and death dates unknown), courtesy name Zixu, was an adviser to the warlord Cao Cao in the late Eastern Han dynasty. He was a subordinate of Cao Cao\'s general Xiahou Yuan. Du Xi proposed to the troops that Zhang He take command after Xiahou Yuan was killed at the Battle of Mount Dingjun. He continued serving as an official in the state of Cao Wei, established by Cao Cao\'s successor Cao Pi, during the Three Kingdoms period.@en', 8),
	(6256, 'Muse Rabile Ghod or Muse Rabile Got (Somali: Muuse Rabiile Good, Arabic: ???? ???? ????) also known as or Col. Muse Rabile Goad; was a Somali military leader, colonel, minister and politician of the former Somali Democratic Republic.@en', 8),
