	(6263, 'Curtius Rufus () was a Roman professional magistrate of senatorial rank mentioned by Tacitus and Pliny the Younger for life events occurring during the reigns of the emperors Tiberius and Claudius. In all probability he is to be equated with the first-century Roman historian Quintus Curtius Rufus.@en', 6),
