	(6270, 'Suzanne \\"Shannie\\" Duff, CM is a Canadian politician, who has served as mayor of St. John\'s, Newfoundland and Labrador and as a member of the Newfoundland and Labrador House of Assembly.@en', 4),
	(6271, 'Ayoub Tabet (1884 - 1947) (Arabic:???? ????) was a Lebanese Protestant politician.@en', 4),
	(6272, 'Ambassador Ersin Erin is a senior Turkish diplomat, with an extensive experience in multilateral diplomacy particularly on matters of international, Euro-Atlantic and Eurasian security, disarmament, and economic and environmental security. He currently serves as Turkish President Abdullah Gls Special Envoy for European Security.@en', 4),
	(6273, 'Joseph C. Casdin was a three-term mayor of Worcester, Massachusetts, and the city\'s first Jewish mayor.@en', 4),
	(6274, 'Cheng Pu (died after 210 CE), courtesy name Demou, was a military general serving under the warlord Sun Quan in the late Eastern Han dynasty. He previously served under Sun Quan\'s predecessors: Sun Jian (Sun Quan\'s father) and Sun Ce (Sun Quan\'s elder brother).@en', 4),
	(6275, 'Eric Fairclough is a Canadian politician, who represented the electoral district of Mayo-Tatchun in the Yukon Legislative Assembly from 1996 to 2011.Originally a member of the Yukon New Democratic Party as well as the party\'s leader from 2001 to 2002, Fairclough quit the party in 2006 after approaching the Yukon Liberal Party. He sat as a Liberal MLA for the remainder of his time in the legislature.Fairclough was formerly a Chief of the Little Salmon/Carmacks First Nation.@en', 4),
	(6276, 'Eric Fairclough is a Canadian politician, who was a Cabinet minister and Leader of the Official Opposition in the Yukon Legislative Assembly. He represented the rural Yukon electoral district of Mayo-Tatchun in the Yukon Legislative Assembly from 1996 to 2011 under both the Yukon New Democratic Party and the Liberals. He is also a former Chief of the Little Salmon/Carmacks First Nation.@en', 4),
	(6277, 'Lin Hatfield Dodds (born Linda Hatfield), Australian social policy expert and former Churchill Fellow, is the Deputy Secretary for Social Policy in the Department of Prime Minister and Cabinet, and former National Director of UnitingCare Australia and Chair of the Australian Social Inclusion Board.@en', 4),
