	(6285, 'Sunil Shastri is an Indian politician and a former cabinet minister in the Government of Uttar Pradesh. Before joining politics, he served the Bank of India as an Officer in different capacities for fourteen years. He was also elected to Uttar Pradesh Legislative Assembly from Gorakhpur assembly constituency as INC candidate.@en', 4),
	(6286, 'H.E. Aung Maung is the mayor ofMyanmar\'s second largest city, Mandalay. He was concurrently appointed as Mandalay\'s mayor of Mandalay and chairman of the Mandalay City Development Committee. He is also the minister for the ministry of Developing of the Mandalay Region.President:Thein SeinPrime minister:Ye MyintPreceded by Phone Zaw HanSucceeded by Ye Lwin.@en', 3),
	(6287, 'Liu Ye (died 234), courtesy name Ziyang, was an adviser to the warlord Cao Cao in the late Eastern Han dynasty. After the fall of the Han dynasty, he served as an official in the state of Cao Wei during the Three Kingdoms period. He was a member of the House of Liu, the imperial clan of the Han dynasty, and a direct descendant of Emperor Guangwu. He had two sons: Liu Yu (??) and Liu Tao (??).@en', 3),
	(6288, 'Huan Jie (birth and death dates unknown), courtesy name Boxu, was an official who lived in the late Eastern Han dynasty. He served in the state of Cao Wei during the Three Kingdoms period after the end of the Han dynasty.@en', 3),
	(6289, 'Mohammad Ali Foroughi (1 January 1875  26 November 1942, Persian: ??????? ??????) also known as Zaka-ol-Molk (Persian: ???????????) was a teacher, diplomat, nationalist, writer, politician and Prime Minister of Iran.@en', 3),
	(6290, 'Abdulkadir Abdinur Hashi (Somali: Cabdulqaadir C/nuur Xaashi, Arabic: ??? ?????? ???????? ?????) is a Somali politician. He previously served as the Minister of State for Planning and International Cooperation of Puntland, and is a Member of the Federal Parliament of Somalia.@en', 3),
	(6291, 'Douglas William Domenech is an American government official and the current Assistant United States Secretary of the Interior for Insular Areas. He is the former Deputy Chief of Staff of the United States Department of the Interior, Senior Advisor to the Secretary of the Interior, and a George W. Bush administration appointee to the White House Working Group on the Political Status of Puerto Rico.@en', 3),
