	(6293, 'Gut Good Skrub@en', 3),
	(6294, 'Mom Rajawongse Seni Pramoj (May 26, 1905  July 28, 1997) (Thai: ?????????????????? ??????, rtgs: Seni Pramot, pronunciation:  [s??.ni? pra?.m?t]) was three times the prime minister of Thailand and a politician in the Democrat Party. A member of the Thai royal family, he was the great-grandson of King Rama II.@en', 3),
	(6295, 'Li Tong (168209), courtesy name Wenda, was a military general serving under the warlord Cao Cao in the late Eastern Han dynasty. Li Tong came to serve Cao Cao when the latter was at war with rival warlords Liu Biao and Zhang Xiu. During the battle of Battle of Nan Commandery in 208, Li Tong broke through the defence lines guarded by Guan Yu and supported Cao Ren at Jiangling. He fell sick during this time and eventually succumbed to illness. He had two sons: Li Xu (??) and Li Ji (??).@en', 3),
	(6296, 'Ahmed Elmi Osman \\"Karaash\\" (Somali: Axmed Cilmi Cismaan, Arabic: ???? ????? ?????) is a Somali politician. He has served as the Minister of Aviation of Puntland, and as one of the presidents of the Khatumo State administration in northern Somalia. Osman is the Minister of Interior of Puntland.@en', 3),
	(6297, 'George Marston was a lawyer who served in various political offices, including as the Attorney General of Massachusetts.@en', 3),
	(6298, 'Heather Keith, formerly known as Heather Keith-Ryan, is an anglophone rights activist from the Eastern Townships region of the Canadian province of Quebec. She has served two terms as president of the Townshippers\' Association and in this capacity has opposed provincial restrictions on the use of the English language. Keith herself is fluent in English and French.@en', 3),
	(6299, 'Alejandro Durano Almendras was a Filipino politician who served as a Senator of the Philippines. He was also governor of the then united Davao province.@en', 3),
