	(9099, 'Subject\'s popular name (birthdate  death) can be a lead-in to the subject\'s real, formal, or extended name. Describe the subject\'s nationality and profession(s) in which the subject is most notable. Provide a description of the subject\'s major contributions in the immediately relevant field(s) of notable expertise.@en', 13),
	(9100, 'Kamehameha I (Hawaiian pronunciation: [k?meh??m?h?]; c.?1736?  May 8 or 14, 1819 ), also known as Kamehameha the Great, (full Hawaiian name: Kalani Pai?ea Wohi o Kaleikini Keali?ikui Kamehameha o ?Iolani i Kaiwikapu kau?i Ka Liholiho K?nui?kea) was the founder and first ruler of the Kingdom of Hawaii. A statue of him was given to the National Statuary Hall Collection in Washington, D.C. by the state of Hawaii as one of two statues it is entitled to give.@en', 10),
	(9101, 'A list of characters from the RTL Television soap opera Rua vjetrova.@en', 10),
	(9102, 'Roger Thorpe and Holly Norris are fictional characters and a supercouple from the American CBS daytime drama Guiding Light.@en', 6),
	(9103, 'Babur (Persian: ?????, lit. \'Tiger\'?; 14 February 1483  26 December 1530), born ?ah?r-ud-D?n Mu?ammad (Persian: ????????? ??????, Zahir al-Din Muhammad), was a conqueror from Central Asia who, following a series of setbacks, finally succeeded in laying the basis for the Mughal dynasty in the Indian subcontinent and became the first Mughal emperor.@en', 6),
	(9104, 'Hey, it\'s OurMine don\'t worry we are just testing your security , please contact us - contactourmineteam@gmail.comhttps://ourmine.org@en', 6),
	(9105, 'Draupadi (Sanskrit: ???????, Sanskrit pronunciation: [d?r??p?d?i]) is one of the most important female characters in the Hindu epic, Mahabharata. According to the epic, she is the daughter of Drupada, King of Panchala.Draupadi is considered as one of the Panch-Kanyas or Five Virgins.@en', 5),
	(9106, 'Gnaeus Pompeius Magnus (Classical Latin: [?gnae?.?s p?m?p?j.j?s ?ma?.n?s]; 29 September 106 BC  29 September 48 BC), usually known in English as Pompey /?p?mpi?/ or Pompey the Great, was a military and political leader of the late Roman Republic. He came from a wealthy Italian provincial background, and his father had been the first to establish the family among the Roman nobility.@en', 5),
	(9107, 'Template:About how Jessica and Ashley became the rulers of Rome. Caesar was their daddy. Keen was brother and R.A.J.A became the great powerful leader of Rome. \\"Gnaeus Pompeius\\"Gnaeus Pompeius Magnus (Classical Latin: [?gnae?.?s p?m?p?j.j?s ?ma?.n?s]; 29 September 106 BC  28 September 48 BC), usually known in English as Pompey /?p?mpi?/ or Pompey the Great, was a military and political leader of the late Roman Republic.@en', 5),
	(9108, 'Saw Omma redirects here. For other people named Saw Omma, see Saw Omma (disambiguation).Saw Omma (Burmese: ????????, pronounced [s?? ??m]) was the chief queen consort of four consecutive kings of Pinya and Ava Kingdoms from 1350 to 1367. Descended from Pagan and MyinsaingPinya royal lines, the queen was well known for her beauty, and was selected as the chief queen of the last three kings of Pinya: Kyawswa II, Narathu and Uzana II.@en', 5),
	(9109, 'Bo Buchanan is a fictional character from the American soap opera One Life to Live.@en', 5),
	(9110, 'Frederick II (26 December 1194  13 December 1250; Sicilian: Fidiricu II, German: Friedrich II) was a Holy Roman Emperor and King of Sicily in the Middle Ages, a member of the House of Hohenstaufen. His political and cultural ambitions, based in Sicily and stretching through Italy to Germany, and even to Jerusalem, were enormous.@en', 4),
	(9111, 'Frederick II (26 December 1194  13 December 1250; Sicilian: Fidiricu, German: Friedrich) was a Holy Roman Emperor, King of the Romans, King of Sicily and King of Jerusalem from the Hohenstaufen dynasty during the Middle Ages. His reign saw the Holy Roman Empire reaching its all time territorial peak. His political and cultural ambitions were enormous as he ruled a vast area beginning with Sicily and stretching through Italy all the way north to Germany.@en', 4),
	(9112, 'She was very nice@en', 4),
	(9113, 'Ibrahim (Ottoman Turkish: ????????, Turkish: ?brahim) (5 November 1615  18 August 1648) was the Sultan of the Ottoman Empire from 1640 until 1648. He was born in Constantinople the son of Ahmed I by Valide Ksem Sultan, an ethnic Greek originally named Anastasia. He was later called Ibrahim the Mad (Turkish: Deli ?brahim) by twentieth century historians due to his reputed mental condition probably psychoneurosis.@en', 4),
	(9114, 'Luc Besson (French: [lyk b?s??]; born 18 March 1959) is a French film director, screenwriter, and producer. He directed or produced the films Subway (1985), The Big Blue (1988), and Nikita (1990). Besson is known for his distinctive filmmaking style and is associated with the movement critics call Cinma du look. He has been nominated for a Csar Award for Best Director and Best Picture for his films Lon: The Professional and The Messenger: The Story of Joan of Arc.@en', 4),
	(9115, 'Luc Besson (French pronunciation: ?[lyk b?s??]; born 18 March 1959) is a French film director, screenwriter, and producer. He directed or produced the films Subway (1985), The Big Blue (1988), and Nikita (1990), all using a distinctive style dubbed Cinma du look by critics. Besson has been nominated for a Csar Award for Best Director and Best Picture for his films Lon: The Professional and The Messenger: The Story of Joan of Arc.@en', 4),
	(9116, 'Carly Snyder (maiden name Tenney; formerly Lowe, Munson, and Dixon) is a fictional character from the CBS soap opera As the World Turns.@en', 4),
	(9117, 'Anita Blake is the title and viewpoint character of the Anita Blake: Vampire Hunter series by Laurell K. Hamilton. The series takes place in a parallel world in which supernatural characters like vampires and werewolves exist alongside regular humans, with Blake\'s jobs including the re-animation of the dead as well as the hunting and executing of supernatural creatures (mostly vampires) that have broken the law.@en', 4),
	(9118, 'Diego Rivera emove the inscription. He stated: \\"To affirm \'God does not exist\', I do not have to hide behind Don Ignacio Ramrez; I am an atheist and I consider religions to be a form of collective neurosis.\\"From the age of ten, Rivera studied art at the Academy of San Carlos in Mexico City. He was sponsored to continue study in Europe by Teodoro A. Dehesa Mndez, the governor of the State of Veracruz.@en', 4),
	(9119, 'Clint Buchanan is a fictional character from the American soap opera One Life to Live.@en', 4),
	(9120, 'David Vickers is a fictional character from the American soap opera One Life to Live portrayed by Tuc Watkins.@en', 4),
	(9121, 'Anita Blake is the title character and protagonist of the Anita Blake: Vampire Hunter series by Laurell K. Hamilton. The series takes place in a parallel world in which supernatural characters like vampires and werewolves exist alongside regular humans, with Blake\'s jobs including the re-animation of the dead as well as the hunting and executing of supernatural creatures (mostly vampires) that have broken the law.@en', 4),
	(9122, 'Svetlana Iosifovna Alliluyeva (Russian: ????????? ?????????? ??????????, Georgian: ???????? ???????? ????????; 28 February 1926  22 November 2011) (born Svetlana Iosifovna Stalina, Russian: ????????? ?????????? ???????, Georgian: ???????? ???????? ???????), later known as Lana Peters, was the youngest child and only daughter of Soviet Premier Joseph Stalin and Nadezhda Alliluyeva, Stalin\'s second wife.@en', 4),
	(9123, 'This is a list of characters in the Showtime series Queer as Folk. The characters are listed alphabetically by their last name or by the name which appears in the episode credits.@en', 4),
	(9124, 'Julia the Elder (30 October 39 BC  AD 14), known to her contemporaries as Julia Caesaris filia or Julia Augusti filia (Classical Latin: IVLIACAESARISFILIA or IVLIAAVGVSTIFILIA), was the daughter and only biological child of Augustus, the first emperor of the Roman Empire. Augustus subsequently adopted several male members of his close family as sons.@en', 3),
	(9125, 'Vincent Leonard Price Jr. (May 27, 1911  October 25, 1993) was an American actor, well known for his distinctive voice and performances in horror films. His career spanned other genres, including film noir, drama, mystery, thriller, and comedy. He appeared on stage, television, radio, and more than one hundred films. He has two stars on the Hollywood Walk of Fame: one for motion pictures, and one for television. Born and raised near St. Louis, Missouri, Price also has a star on the St.@en', 3),
	(9126, 'Lady Catherine Gordon (c.?1474October 1537) was a Scottish noblewoman and the wife of Yorkist pretender, Perkin Warbeck /Richard Duke Of York. After her imprisonment by King Henry VII of England, she became a favoured lady-in-waiting of his wife, Elizabeth of York. She had a total of four husbands, but there are no records she had any surviving children.@en', 3),
	(9127, 'Victor Lord is a fictional character and patriarch of the Lord family from the American soap opera One Life to Live.An original protagonist on the series, Victor is introduced in the first episode as the preeminent mass media magnate of fictional Philadelphia Main Line suburb Llanview, Pennsylvania. Victor was originally and most notably played by actor Ernest Graves.@en', 3),
	(9128, 'This is a list of characters from the police procedural British television series, The Bill. The fictional characters displayed here are ordered alphabetically by character surname. For a full list of current characters ordered by rank, see list of The Bill characters. The characters are all police officers or civil support staff operating from the fictional Sun Hill Police Station within the London borough of Canley, London.@en', 3),
	(9129, 'Denise Nicholas (born Donna Denise Nicholas; July 12, 1944) is an African-American actress and social activist who was involved in the Civil Rights Movement. She is known primarily for her role as high school guidance counselor Liz McIntyre on the ABC comedy-drama series Room 222, and for her role as Councilwoman Harriet DeLong on the NBC/CBS drama series In the Heat of the Night.@en', 3),
	(9130, 'He\'s a terrible artist who is the living version of Satan@en', 3),
	(9131, 'Bree Weston (also known in the series as Bree Van de Kamp and Bree Hodge) is a fictional character and one of the four protagonists on the ABC television series Desperate Housewives. She is played by actress Marcia Cross, who has received multiple awards and nominations for her portrayal, including an Emmy Award nomination, three Golden Globe Award nominations, and two Screen Actors Guild Awards.@en', 3),
