	(9140, 'Vincent Leonard Price, Jr. (May 27, 1911  October 25, 1993) was an American actor, well known for his distinctive voice and performances in horror films. His career spanned other genres, including film noir, drama, mystery, thriller, and comedy. He appeared on stage, television, radio, and in over one hundred films. He has two stars on the Hollywood Walk of Fame: one for motion pictures, and one for television.Price was an art collector and consultant, with a degree in art history.@en', 3),
