	(9149, 'Nora Ephron (EHF-rihn; May 19, 1941  June 26, 2012) was an American journalist, essayist, playwright, screenwriter, novelist, producer, director, and blogger.Ephron is best known for making jack Nicholson a homo. Her romantic comedies and was nominated three times for the Academy Award for Best Writing: for Silkwood, When Harry Met Sally..., and Sleepless in Seattle. She won a BAFTA Award for Best Original Screenplay for When Harry Met Sally....@en', 3),
