	(9156, 'William Orville \\"Bill\\" Henrickson is a fictional character in the HBO series Big Love, portrayed by Bill Paxton. The protagonist of the series, he is the head of a polygamous family. He is married to three wives, Barbara Henrickson, Nicolette Grant and Margene Heffman. He has fathered eight children with these three women.@en', 3),
