	(9158, 'Manisanda Khin U (Burmese: ???????? ????? [m?n?s?d k???? ?]) was queen to three consecutive kings of Pagan dynasty of Burma (Myanmar). The ethnic Mon queen is famous in Burmese history for her love triangle with Gen. Kyansittha and King Anawrahta. Their story has been compared to the legend of King Arthur, Lancelot and Guinevere.Manisanda was a daughter of the ruler of Pegu (Bago), which was subject to Pagan.@en', 3),
	(9159, 'Ebbe Rode (10 May 1910  23 May 1998) was a Danish stage and film actor. His father was the writer/critic Helge Rode. Ebbe Rode was married to actress Helle Virkner.@en', 3),
	(9160, 'Frederick I (German: Friedrich I.) (11 July 1657  25 February 1713), of the Hohenzollern dynasty, was (as Frederick III) Elector of Brandenburg (16881713) and Duke of Prussia in personal union (Brandenburg-Prussia). The latter function he upgraded to royalty, becoming the first King in Prussia (17011713). From 1707 he was in personal union the sovereign prince of the Principality of Neuchtel (German: Frstentum Neuenburg). He was also the paternal grandfather of Frederick the Great.@en', 3),
	(9161, 'Barbara \\"Barb\\" Dutton Henrickson is a character on HBO\'s Big Love portrayed by Jeanne Tripplehorn. Barb is the first wife of Bill Henrickson. Barb was raised in a traditional Mormon family, outside polygamy. Bill and Barb met while in college, and married soon afterwards. Together, they had three children.@en', 3),
	(9162, 'Jake McKinnon is a fictional character, portrayed by Tom Eplin throughout its entirety. Debuting on NBC\'s daytime drama, Another World, after its cancellation, the character crossed over to the CBS daytime drama, As the World Turns.@en', 3),
	(9163, 'Shin Saw Gyi (Burmese: ???????????, pronounced [???? s?? d?]) was a chief queen consort of King Swa Saw Ke of Ava. She was also a principal queen of kings Kyawswa II of Pinya and Narathu of Pinya. She was a granddaughter of King Saw Yun, the founder of Sagaing Kingdom, and a sister of King Thado Minbya, the founder of Ava Kingdom. She was originally a queen consort of Swa, and was given the title of Queen of the Northern Palace and Pinya in fief.@en', 3),
	(9164, 'Myauk Pyinthe (Burmese: ?????????????, pronounced [mjau? pj? ??] or [mjau? bj? ??]; lit. \\"Queen of the Northern Palace\\") was a queen consort of three kings of Pagan, Saw Rahan II, Kunhsaw Kyaunghpyu and Sokkate, and the mother of King Anawrahta, the founder of the Pagan Empire.@en', 3),
	(9165, 'Margene \\"Margie\\" Heffman is a character on Big Love, the fictional HBO television series set among contemporary polygamists in Utah. The role is played by Ginnifer Goodwin. The show focuses on the family of Bill Henrickson; Margene is the third of Henrickson\'s three wives, and the biological mother of three of Henrickson\'s children: Aaron, Lester, and Nell.@en', 3),
	(9166, 'Nicolette Eugenia \\"Nicki\\" Grant is a character in Big Love, the HBO television series set among contemporary polygamists in Utah. The role is played by Chlo Sevigny. The show focuses on the family of Bill Henrickson; Nicki is the second of Henrickson\'s three wives, and the biological mother to two of Henrickson\'s children, Wayne and Raymond.@en', 3),
