	(9170, 'Judith Rose Balaban (born 1932) is an American actress and author who wrote the book The Bridesmaids: Grace Kelly and Six Intimate Friends about Grace Kelly. Balaban was a childhood friend of Grace Kelly and served as a bridesmaid in her wedding to Rainier III, Prince of Monaco.@en', 3),
	(9171, 'K?nekap?lei was a Hawaiian High Chiefess, wife of Kalani??pu?u and the aunt of Kamehameha I. She was present at the time of Captain Cook\'s death, calling attention to the kidnapping of her husband by Cook and his sailors. A group of men from among those attracted to the beach to answer her calls for help grabbed Cook and stabbed him to death.@en', 2),
	(9172, 'In the Hindu epic Mahabharata, Bhima or Bhimsen (Sanskrit: ???) is the second of the Pandavas. The Mahabharata relates many events which portray the immense might of Bhima. Bhima is responsible for slaying all hundred Kaurava brothers in the Kurukshetra War.@en', 2),
	(9173, 'Maharishi Bhrigu (Sanskrit: Bh?gu) was one of the seven great sages, the Saptarshis, one of the many Prajapatis (the facilitators of Creation) created by [[Brahma] Born in ballia. (The God of Creation), the first compiler of predictive astrology, and also the author of Bhrigu Samhita, the astrological (Jyotish) classic. Bhrigu is considered as a Manasa Putra (mind-born-son) of Brahma. The adjectival form of the name, Bhargava, is used to refer to the descendants and the school of Bhrigu.@en', 2),
	(9174, 'Gordon \\"Drewe\\" Henley (1940  14 February 2016) was a British actor. He had a variety of roles in film, television and theatre including as Red X-Wing Squadron Leader Garven Dreis in Star Wars Episode IV: A New Hope. He retired from acting due to manic depression. He was married to Felicity Kendal, with whom he had a son.@en', 2),
