	(9182, 'Portia Lee James DeGeneres (born Amanda Lee Rogers; January 31, 1973) also known professionally as Portia de Rossi /?p??r?? d? ?r?si/, is an Australian-American actress, model, and philanthropist known for her roles as lawyer, Nelle Porter on the television series, Ally McBeal and Lindsay Fnke on the sitcom Arrested Development. She also portrayed Veronica Palmer on the ABC sitcom Better Off Ted and Olivia Lord on Nip/Tuck.@en', 2),
