	(9184, 'Sigrid the Haughty, also known as Sigr Storrda, is a queen appearing in Norse sagas as wife, first of Eric the Victorious of Sweden, then Sweyn Forkbeard of Denmark. Sigrid appears in many sagas composed generations after the events they describe, but there is no reliable evidence as to her existence as they describe her.@en', 2),
