	(9186, 'Leland Jones Orser is an American film and television actor. Orser is primarily a character actor, whose career has included playing a number of deranged, psychotic, and degenerate characters. Orser has appeared in small roles in a wide variety of films and television series, including Chief of Surgery Dr. Lucien Dubenko on the television series ER.@en', 2),
