	(9192, 'Anthony (27 December 1755 in Dresden  6 June 1836 in Dresden), also known by his German name Anton (full name: Anton Clemens Theodor Maria Joseph Johann Evangelista Johann Nepomuk Franz Xavier Aloys Januar), was a King of Saxony (18271836) from the House of Wettin. He became known as Anton der Gtige, (en: \\"Anthony the Kind\\").He was the fifth but third surviving son of Frederick Christian, Elector of Saxony, and Maria Antonia of Bavaria.@en', 2),
