	(9752, 'Ibrahim (Ottoman Turkish: ????????, Turkish: ?brahim) (5 November 1615  18 August 1648) was the Sultan of the Ottoman Empire from 1640 until 1648. He was born in Constantinople the son of Ahmed I by Valide Ksem Sultan, an ethnic Greek originally named Anastasia. He was later called Ibrahim the Mad (Turkish: Deli ?brahim) by twentieth century historians due to his reputed mental condition probably psychoneurosis.@en', 4),
