	(9761, 'This is a list of characters from the police procedural British television series, The Bill. The fictional characters displayed here are ordered alphabetically by character surname. For a full list of current characters ordered by rank, see list of The Bill characters. The characters are all police officers or civil support staff operating from the fictional Sun Hill Police Station within the London borough of Canley, London.@en', 3),
	(9762, 'Denise Nicholas (born Donna Denise Nicholas; July 12, 1944) is an African-American actress and social activist who was involved in the Civil Rights Movement. She is known primarily for her role as high school guidance counselor Liz McIntyre on the ABC comedy-drama series Room 222, and for her role as Councilwoman Harriet DeLong on the NBC/CBS drama series In the Heat of the Night.@en', 3),
	(9763, 'He\'s a terrible artist who is the living version of Satan@en', 3),
	(9764, 'Vivian Alamain is a fictional character from the American NBC soap opera Days of Our Lives, played by Louise Sorel.@en', 3),
	(9765, 'Lady Catherine Gordon (c.?1474October 1537) was a Scottish noblewoman and the wife of Yorkist pretender, Perkin Warbeck /Richard Duke Of York. After her imprisonment by King Henry VII of England, she became a favoured lady-in-waiting of his wife, Elizabeth of York. She had a total of four husbands, but there are no records she had any surviving children.@en', 3),
	(9766, 'Marius de Romanus is a fictional character in The Vampire Chronicles novels written by Anne Rice. He is the primary character in the novel Blood and Gold.@en', 3),
	(9767, 'William Orville \\"Bill\\" Henrickson is a fictional character in the HBO series Big Love, portrayed by Bill Paxton. The protagonist of the series, he is the head of a polygamous family. He is married to three wives, Barbara Henrickson, Nicolette Grant and Margene Heffman. He has fathered eight children with these three women.@en', 3),
	(9768, 'Margene \\"Margie\\" Heffman is a character on Big Love, the fictional HBO television series set among contemporary polygamists in Utah. The role is played by Ginnifer Goodwin. The show focuses on the family of Bill Henrickson; Margene is the third of Henrickson\'s three wives, and the biological mother of three of Henrickson\'s children: Aaron, Lester, and Nell.@en', 3),
	(9769, 'Nicolette Eugenia \\"Nicki\\" Grant is a character in Big Love, the HBO television series set among contemporary polygamists in Utah. The role is played by Chlo Sevigny. The show focuses on the family of Bill Henrickson; Nicki is the second of Henrickson\'s three wives, and the biological mother to two of Henrickson\'s children, Wayne and Raymond.@en', 3),
	(9770, 'Joey Buchanan is a fictional character from the American daytime serial One Life to Live. The character is the son of original protagonists Victoria Lord and Joe Riley, Sr.@en', 3),
	(9771, 'Denise Nicholas (born Donna Denise Nicholas; July 12, 1944) is an American actress and social activist who was involved in the Civil Rights Movement. She is known primarily for her role as high school guidance counselor Liz McIntyre on the ABC comedy-drama series Room 222, and for her role as Councilwoman Harriet DeLong on the NBC/CBS drama series In the Heat of the Night.@en', 3),
	(9772, 'Donna Denise Nicholas (born July 12, 1944) is an American actress and social activist who was involved in the Civil Rights Movement. She is known primarily for her role as high-school guidance counselor Liz McIntyre on the ABC comedy-drama series Room 222, and for her role as Councilwoman Harriet DeLong on the NBC/CBS drama series In the Heat of the Night.@en', 3),
	(9773, 'Frederick I (German: Friedrich I.) (11 July 1657  25 February 1713), of the Hohenzollern dynasty, was (as Frederick III) Elector of Brandenburg (16881713) and Duke of Prussia in personal union (Brandenburg-Prussia). The latter function he upgraded to royalty, becoming the first King in Prussia (17011713). From 1707 he was in personal union the sovereign prince of the Principality of Neuchtel (German: Frstentum Neuenburg). He was also the paternal grandfather of Frederick the Great.@en', 3),
	(9774, 'The Khadr family (???? ???) is an Arab-Canadian family noted for their ties to Osama bin Laden and connections to al Qaeda.@en', 3),
	(9775, 'Miko?aj Spytek Lig?za (c. 15621637) was a PolishLithuanian noble (szlachcic). He was castellan of Czechw, ?arnw, Sandomierz and was owner of Rzeszw.He had two children: Pudencajna Lig?za and Konstancja Lig?za.@en', 3),
	(9776, 'Janice Soprano Baccalieri, played by Aida Turturro, is a fictional character on the HBO TV series The Sopranos. She is Tony Soprano\'s elder sister. A young Janice has appeared in flashbacks, played by Madeline Blue and Juliet Fox.@en', 3),
	(9777, 'This is a list of the characters from the American comedy-drama television series The Game.@en', 3),
	(9778, 'Tina Lord is a fictional character from the American daytime soap opera One Life to Live, originally and last played by Andrea Evans. The character is the daughter of original series patriarch Victor Lord, and sister to long-running characters Victoria Lord and Todd Manning.@en', 3),
	(9779, 'Christina Stone was a business woman, and was married Loke Wan Tho, a Singaporean business magnate and later to Jeffrey Stone a film director. Her final marriage was to the Parsi businessman, Dadi Balsara.@en', 3),
	(9780, 'Jake McKinnon is a fictional character, portrayed by Tom Eplin throughout its entirety. Debuting on NBC\'s daytime drama, Another World, after its cancellation, the character crossed over to the CBS daytime drama, As the World Turns.@en', 3),
	(9781, 'Judith Rose Balaban (born 1932) is an American actress and author who wrote the book The Bridesmaids: Grace Kelly and Six Intimate Friends about Grace Kelly. Balaban was a childhood friend of Grace Kelly and served as a bridesmaid in her wedding to Rainier III, Prince of Monaco.@en', 3),
	(9782, 'K?nekap?lei was a Hawaiian High Chiefess, wife of Kalani??pu?u and the aunt of Kamehameha I. She was present at the time of Captain Cook\'s death, calling attention to the kidnapping of her husband by Cook and his sailors. A group of men from among those attracted to the beach to answer her calls for help grabbed Cook and stabbed him to death.@en', 2),
	(9783, 'In the Hindu epic Mahabharata, Bhima or Bhimsen (Sanskrit: ???) is the second of the Pandavas. The Mahabharata relates many events which portray the immense might of Bhima. Bhima is responsible for slaying all hundred Kaurava brothers in the Kurukshetra War.@en', 2),
	(9784, 'Gordon \\"Drewe\\" Henley (1940  14 February 2016) was a British actor. He had a variety of roles in film, television and theatre including as Red X-Wing Squadron Leader Garven Dreis in Star Wars Episode IV: A New Hope. He retired from acting due to manic depression. He was married to Felicity Kendal, with whom he had a son.@en', 2),
	(9785, 'Gordon \\"Drewe\\" Henley (1940  14 January 2017) was a British actor. He had a variety of roles in film, television and theatre including as Red X-Wing Squadron Leader Garven Dreis in Star Wars Episode IV: A New Hope. He retired from acting due to manic depression. He was married to Felicity Kendal, with whom he had a son.@en', 2),
	(9786, 'Tony Hoffer is an American producer, songwriter, and music mixer.@en', 2),
	(9787, 'Mindy Lewis is a fictional character in the town of Springfield on the CBS daytime drama, Guiding Light, originated and, most notably, portrayed by actress, Krista Tesreau.@en', 2),
	(9788, 'Kalani Kama Ke?eaumoku-nui was a Prince of the Big Island of Hawai?i and high chief of the Kona district and part of Kohala district and grandfather of Kamehameha I. He was a Pi?o chief which was considered among royalties of the highest rank in the realm.@en', 2),
	(9789, 'Christopher Guy Denis Lambert (born 29 March 1957), known as Christopher Lambert, is a French-American actor who was born in the United States. He played Connor MacLeod in Highlander and subsequent movie franchise series of the same name. He played Tarzan in Greystoke: The Legend of Tarzan, Lord of the Apes and the thunder god Raiden in the first movie adaptation of the video game Mortal Kombat.@en', 2),
	(9790, 'Pat Silver-Lasky is an American actress, screenwriter, and writer, mostly known for her collaborations with her second husband Jesse Lasky Jr.@en', 2),
	(9791, 'Leland Jones Orser is an American film and television actor. Orser is primarily a character actor, whose career has included playing a number of deranged, psychotic, and degenerate characters. Orser has appeared in small roles in a wide variety of films and television series, including Chief of Surgery Dr. Lucien Dubenko on the television series ER.@en', 2),
