	(9793, 'Madeleine A. Pickens (born March 5, 1947 in Kirkuk, Iraq) is an Iraqi-born American businesswoman and philanthropist. She is the owner of the Del Mar Country Club in Rancho Santa Fe, California, and the Mustang Monument: Wild Horse Eco-Resort near Wells, Nevada and the founder of Saving America\'s Mustangs. She is also a thoroughbred racehorse owner and breeder. She is the former wife of American billionaires Allen E. Paulson and T. Boone Pickens.@en', 2),
