	(9806, 'Edward Carl \\"Eddie\\" Cibrian ( SIB-ree-?n; born June 16, 1973) is an American actor. He is best known for his television role as Cole Deschanel on Sunset Beach, which gained popularity for the actor in the 1990s. He has also appeared in multiple films and as a cast member in several other television series, filling such roles as Russell Varon in Invasion, Jimmy Doherty on Third Watch and Jesse Cardoza in CSI: Miami.@en', 2),
	(9807, 'Kim Delaney (born November 29, 1961) is an American actress known for her starring role as Detective Diane Russell on the ABC drama television series NYPD Blue, for which she has won an Emmy Award. Early in her career, she played the role of Jenny Gardner in the ABC daytime television drama All My Children. She later had leading roles in the TV dramas Philly, CSI: Miami and on the Lifetime television drama Army Wives.@en', 2),
	(9808, 'Alan IV (born circa 1063; died 13 October 1119) was Duke of Brittany from 1084 until his abdication in 1112. He was also Count of Nantes (from c. 1103) and Count of Rennes. His parents were Hawise, Duchess of Brittany and Hoel II. He is also known as Alan Fergant. Through his father, he was of the Breton House of Cornouaille dynasty (Breton: Kerne dynasty). He was the last Breton-speaking Duke of Brittany.@en', 2),
