	(9812, 'Jamie Merill Babbit (born November 16, 1970) is an American film director, producer and screenwriter. She directed the films But I\'m a Cheerleader, The Quiet and Itty Bitty Titty Committee. She has also directed episodes of television programs including Gilmore Girls, Malcolm in the Middle, United States of Tara, Looking, Nip/Tuck, and The L Word.@en', 2),
	(9813, 'Nakhat Khan, known by her stage name Kushboo, is an Indian film actress, producer, and television presenter. She is predominantly known for her works in the South Indian film industry. She has received one Kerala State Film awards and two Tamil Nadu State Film Awards for Best Actress@en', 2),
	(9814, 'Jenny Sullivan (born December 14, 1946) is an American film and television actress. She has starred in some made for TV movies, her best-known role is reporter Kristine Walsh in the 1983 NBC hit miniseries V and its 1984 sequel V: The Final Battle.@en', 2),
